import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CurrencyRate = () => {

  const [currencyData, setCurrencyData] = useState({});

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/AllCurrency')
      .then((response) => {
        setCurrencyData(response.data.data);
      })
      .catch((error) => {
        console.error('Error fetching data: ', error);
      });
  }, []);


  let tr = currencyData.map((currencyCode,index)=>{
    return<tr key={index}>
    <td>{index + 1}</td>
    <td>{currencyData[currencyCode].code}</td>
    <td>{currencyData[currencyCode].value}</td>
    </tr>
      })
  return (
    <div>
      <h1>Currency Exchange Rates</h1>
      <table>
        <thead>
          <tr>
            <th>Currency Code</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
      {tr}
      </tbody>
      </table>
    </div>
  )
}

export default CurrencyRate
